INSERT INTO `ts_group_product` VALUES (1, 227, 7, 1, 1, '【突尼斯石榴】1个/份', 3, 0, 0.00, 5.00, 1.00, 0, 1, 0, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1537876214, 1537876214);
INSERT INTO `ts_group_product` VALUES (2, 227, 7, 1, 2, '【海南紫水晶红心火龙果】4个/份 ', 0, 0, 15.00, 25.00, 19.90, 0, 0, 1, '紫水晶红心火龙果的糖分达20°以上，味儿，口感特甜，个大饱满中间圆润并凸起，果皮外像鳞一样一片片外翻为上品，', 1537876214, 1537876214);
INSERT INTO `ts_group_product` VALUES (3, 227, 8, 2, 9, '【突尼斯石榴】1个/份', 38, 0, 0.00, 5.00, 1.00, 0, 1, 0, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1537890617, 1537976475);
INSERT INTO `ts_group_product` VALUES (4, 227, 8, 2, 11, '【新疆吐鲁番西州蜜 哈密瓜】1个/份 4斤左右', 32, 0, 12.00, 8.00, 5.00, 0, 0, 1, '来自火焰山的甜蜜问候。唤醒你的味觉！\n甘甜可口 肉质细嫩，果肉越靠近中心处甜度越高，清脆爽口，汁多且无渣，清香四溢。', 1537890617, 1537976475);
INSERT INTO `ts_group_product` VALUES (5, 227, 8, 2, 16, '【海南紫水晶红心火龙果】4个/份 ', 8, 0, 20.00, 25.00, 19.90, 0, 0, 2, '紫水晶红心火龙果的糖分达20°以上，味儿，口感特甜，个大饱满中间圆润并凸起，果皮外像鳞一样一片片外翻为上品，而且捏起来有一点点软的这样的会超级好吃，爆汁的甜，不甜不要钱，我敢这样说。\n特别说明：皮皱，叶鳞发黑，是它在树上就长成这样，因为这款紫水晶皮薄，受到北纬18°的高温炙烤，造成皱皮，叶鳞枯萎，但果肉相反甜到爆，是这款紫水晶火龙果的标志。\n', 1537890617, 1537976475);
INSERT INTO `ts_group_product` VALUES (6, 227, 8, 2, 17, '【自家山核桃】5斤/份', 1, 0, 10.00, 25.00, 19.90, 0, 0, 4, '自己家里的山核桃，无水洗，不漂白，更健康，原滋原味，果仁吃起来 脆嫩香甜，带着淡淡的核桃香。\n', 1537890617, 1537976475);
INSERT INTO `ts_group_product` VALUES (7, 227, 8, 2, 18, '【无淀粉肉肠】10根/份', 14, 0, 10.00, 25.00, 19.00, 0, 0, 5, '无淀粉全肉肠，满口留香，劲道口感，手抓饼好搭档。微波炉加热食用。\n', 1537890617, 1537976475);
INSERT INTO `ts_group_product` VALUES (8, 227, 8, 2, 19, '【喜世牛肉饼】10个*1袋/份', 1, 0, 10.00, 26.00, 23.80, 0, 0, 6, '鲜香多汁，美味可口，入口香酥，肉香四溢，香而不腻，风味独特，外焦里嫩，‍回味悠长。\n', 1537890617, 1537976475);
INSERT INTO `ts_group_product` VALUES (9, 227, 8, 2, 20, '【80食堂酸辣粉】140克*2盒', 1, 0, 10.00, 18.00, 14.90, 0, 0, 7, '80食堂酸辣粉，大街小巷小馆子的童年老味道。红薯粉丝，品质更高。香滑细嫩，缠绵清爽！秘制椒香，红油辣子采用多种味料精心炒制而成，麻辣鲜香！陈年食醋，与红油辣子一同构成酸辣鲜爽的馋人味道！秘制料，熟花生，香脆鲜香，一包料，让汤更鲜美！美味豆皮，劲道有力，在粉丝缠绵口感之外，增加咀嚼', 1537890617, 1537976475);
INSERT INTO `ts_group_product` VALUES (10, 227, 8, 2, 21, '【五香花卷】 60个/带', 1, 0, 10.00, 22.00, 18.90, 0, 0, 8, '乡间石磨小麦粉，整粒麦的营养都在里面，吃起来粮食味浓郁醇香。\n童年是梦 是诗，让人慢慢品味，顽皮的我们，喜欢课堂背着老师偷偷分享，喜欢揪着女同学的长发，喜欢……儿时的味道，怀念就把它带回家吧', 1537890617, 1537976475);
INSERT INTO `ts_group_product` VALUES (11, 227, 8, 2, 23, '【六合无骨鸡柳】2斤*1袋', 1, 0, 10.00, 25.00, 19.90, 0, 0, 9, '让你的味蕾来跳舞，油炸后‍回味悠长，更是带着美味扑鼻的香气，口感松脆鲜香，嫩滑香脆，搭配番茄酱吃到嘴里味道甜美，外皮酥嫩，色泽金黄，气味鲜香诱人，口感饱满嫩滑而富有弹性。', 1537890617, 1537976476);
INSERT INTO `ts_group_product` VALUES (12, 227, 8, 2, 24, '【沾化冬枣】2斤/份', 7, 0, 10.00, 12.00, 9.90, 0, 0, 3, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1537890617, 1537976475);
