INSERT INTO `ts_group_product` VALUES (70, 235, 8, 8, 21, '【五香花卷】 60个/带', 0, 0, 10.00, 22.00, 18.90, 0, 0, 8, '乡间石磨小麦粉，整粒麦的营养都在里面，吃起来粮食味浓郁醇香。\n童年是梦 是诗，让人慢慢品味，顽皮的我们，喜欢课堂背着老师偷偷分享，喜欢揪着女同学的长发，喜欢……儿时的味道，怀念就把它带回家吧', 1537918614, 1537976476);
INSERT INTO `ts_group_product` VALUES (71, 235, 8, 8, 23, '【六合无骨鸡柳】2斤*1袋', 0, 0, 10.00, 25.00, 19.90, 0, 0, 9, '让你的味蕾来跳舞，油炸后‍回味悠长，更是带着美味扑鼻的香气，口感松脆鲜香，嫩滑香脆，搭配番茄酱吃到嘴里味道甜美，外皮酥嫩，色泽金黄，气味鲜香诱人，口感饱满嫩滑而富有弹性。', 1537918614, 1537976476);
INSERT INTO `ts_group_product` VALUES (72, 235, 8, 8, 24, '【沾化冬枣】2斤/份', 0, 0, 10.00, 12.00, 9.90, 0, 0, 3, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1537918614, 1537976475);
INSERT INTO `ts_group_product` VALUES (73, 237, 8, 9, 9, '【突尼斯石榴】1个/份', 7, 0, 0.00, 5.00, 1.00, 0, 1, 0, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1537919317, 1537976475);
INSERT INTO `ts_group_product` VALUES (74, 237, 8, 9, 11, '【新疆吐鲁番西州蜜 哈密瓜】1个/份 4斤左右', 3, 0, 12.00, 8.00, 5.00, 0, 0, 1, '来自火焰山的甜蜜问候。唤醒你的味觉！\n甘甜可口 肉质细嫩，果肉越靠近中心处甜度越高，清脆爽口，汁多且无渣，清香四溢。', 1537919317, 1537976475);
INSERT INTO `ts_group_product` VALUES (75, 237, 8, 9, 16, '【海南紫水晶红心火龙果】4个/份 ', 0, 0, 20.00, 25.00, 19.90, 0, 0, 2, '紫水晶红心火龙果的糖分达20°以上，味儿，口感特甜，个大饱满中间圆润并凸起，果皮外像鳞一样一片片外翻为上品，而且捏起来有一点点软的这样的会超级好吃，爆汁的甜，不甜不要钱，我敢这样说。\n特别说明：皮皱，叶鳞发黑，是它在树上就长成这样，因为这款紫水晶皮薄，受到北纬18°的高温炙烤，造成皱皮，叶鳞枯萎，但果肉相反甜到爆，是这款紫水晶火龙果的标志。\n', 1537919317, 1537976475);
INSERT INTO `ts_group_product` VALUES (76, 237, 8, 9, 17, '【自家山核桃】5斤/份', 0, 0, 10.00, 25.00, 19.90, 0, 0, 4, '自己家里的山核桃，无水洗，不漂白，更健康，原滋原味，果仁吃起来 脆嫩香甜，带着淡淡的核桃香。\n', 1537919317, 1537976475);
INSERT INTO `ts_group_product` VALUES (77, 237, 8, 9, 18, '【无淀粉肉肠】10根/份', 0, 0, 10.00, 25.00, 19.00, 0, 0, 5, '无淀粉全肉肠，满口留香，劲道口感，手抓饼好搭档。微波炉加热食用。\n', 1537919317, 1537976475);
