INSERT INTO `ts_group_product` VALUES (149, 221, 12, 13, 58, '【西班牙原装进口橄榄油】250ml*1瓶/份', 0, 0, 10.00, 36.00, 28.80, 0, 0, 14, '伯爵品质 经典传承，油中贵族，口服，凉拌，清炒，蒸饭，做汤，煎炸，烧烤， 蘸食，护肤均可使用，‍橄榄油被认为是迄今发现的油脂中最适合人体营养的油脂，具有活血化瘀，降压降脂，美容养颜，健脑益智，长期食用还可以提高记忆力和抵抗力。\n', 1538065492, 1538207534);
