INSERT INTO `ts_group_product` VALUES (168, 227, 12, 14, 57, '【冰雪皇后芝麻夹心海苔】4克*10小包*2包/份', 1, 0, 10.00, 18.00, 14.90, 0, 0, 13, '真正的夹心海苔，做到真正的鲜 香 脆！片片饱满的芝麻，铺在香酥的双面海苔上。香 酥 脆的优质口感，富含多重营养成分！满满的芝麻，非油炸更健康。保质期12个月，开袋即食。\n', 1538065616, 1538207534);
INSERT INTO `ts_group_product` VALUES (169, 227, 12, 14, 58, '【西班牙原装进口橄榄油】250ml*1瓶/份', 0, 0, 10.00, 36.00, 28.80, 0, 0, 14, '伯爵品质 经典传承，油中贵族，口服，凉拌，清炒，蒸饭，做汤，煎炸，烧烤， 蘸食，护肤均可使用，‍橄榄油被认为是迄今发现的油脂中最适合人体营养的油脂，具有活血化瘀，降压降脂，美容养颜，健脑益智，长期食用还可以提高记忆力和抵抗力。\n', 1538065616, 1538207534);
INSERT INTO `ts_group_product` VALUES (170, 227, 12, 14, 59, '【得利斯奶黄包】 12个*2袋/份', 0, 0, 10.00, 18.00, 11.80, 0, 0, 15, '优选小麦粉，弹滑面皮不粘牙，入口香甜软绵，舌尖味蕾悠然舒展。\n小小个造型，香甜软绵。\n用心挑选，自然与汗水的结晶，造就美味食品，免去繁琐制作过程，加热即可，美味即成。', 1538065616, 1538207534);
