INSERT INTO `ts_group_product` VALUES (175, 236, 12, 15, 44, '【琯溪三红蜜柚】3斤左右*2个/份', 1, 0, 15.00, 30.00, 24.90, 0, 0, 0, '皮红，囊红，肉红，千娇百媚，让你垂涎欲滴，未见其肉，先闻其香，水分充足，唇齿留香，汁多细腻，香甜可口，诱惑红肉，粒粒饱满晶莹。\n', 1538071405, 1538207534);
INSERT INTO `ts_group_product` VALUES (176, 236, 12, 15, 45, '【自家现挖毛芋头】4斤/份', 4, 0, 15.00, 12.00, 9.90, 0, 0, 1, '自己老家的毛芋头，自己种植，自然成熟，不使用任何农药，吃的放心，清香软糯，绵柔软滑，甘甜可口，蒸 炒 炸 炖皆可，我都是香芋炖排骨吃，‍恰到好处的美妙滋味，老少皆宜。\n', 1538071405, 1538207534);
