INSERT INTO `ts_group_product` VALUES (202, 237, 12, 16, 51, '【进口奶油夹心威化球】椰子味 300克*1包/份', 0, 0, 12.00, 38.00, 29.90, 0, 0, 7, '波兰直购，欧盟食品认证，奶油夹心花生酥威化球，伴着淡淡的香气，甜滑爽口，酥脆柔滑奇妙结合，丝滑奶油，香浓花生，甜而不腻，回味无穷，源自波兰美味。\n', 1538086082, 1538207534);
