INSERT INTO `ts_group_product` VALUES (206, 237, 12, 16, 55, '【古早手工蛋糕】2个/份', 0, 0, 18.00, 12.00, 9.90, 0, 0, 11, '好品质源自好食材，卖相很Q，抵挡不住的美味诱惑，和牛奶一起吃，更好吃哦，金黄饱满，香浓软糯，吃起来奶香味浓，如云朵般轻盈软润的口感，入口即化，香味自然，‍传统手工艺制作。\n', 1538086082, 1538207534);
