INSERT INTO `ts_group_product` VALUES (218, 239, 12, 17, 47, '【沾化冬枣】2斤/份', 0, 0, 10.00, 12.00, 9.90, 0, 0, 3, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1538087203, 1538207534);
