INSERT INTO `ts_group_product` VALUES (236, 234, 12, 18, 45, '【自家现挖毛芋头】4斤/份', 5, 0, 15.00, 12.00, 9.90, 0, 0, 1, '自己老家的毛芋头，自己种植，自然成熟，不使用任何农药，吃的放心，清香软糯，绵柔软滑，甘甜可口，蒸 炒 炸 炖皆可，我都是香芋炖排骨吃，‍恰到好处的美妙滋味，老少皆宜。\n', 1538087966, 1538207534);
INSERT INTO `ts_group_product` VALUES (237, 234, 12, 18, 46, '【四川安岳黄柠檬】2个*2包/份', 1, 0, 25.00, 13.00, 9.90, 0, 0, 2, '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1538087966, 1538207534);
INSERT INTO `ts_group_product` VALUES (238, 234, 12, 18, 47, '【沾化冬枣】2斤/份', 3, 0, 10.00, 12.00, 9.90, 0, 0, 3, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1538087966, 1538207534);
INSERT INTO `ts_group_product` VALUES (239, 234, 12, 18, 48, '【FRUGO 100%苹果汁】250ML*2瓶/份', 0, 0, 15.00, 15.00, 9.90, 0, 0, 4, '波兰原瓶原装直购，百分百纯苹果汁，维生素C丰富，可增强人体抵抗力和机体的解毒功能，苹果汁是美容佳品，既减肥又能让皮肤润滑柔嫩，苹果中还有铜，碘，锰，锌，钾等元素，补充人体所需营养物质。无添加剂，百分百原汁。\n', 1538087966, 1538207534);
INSERT INTO `ts_group_product` VALUES (240, 234, 12, 18, 49, '【圣塔索菲亚 管状意大利面】500克*1包/份', 0, 0, 10.00, 15.00, 10.90, 0, 0, 5, '土耳其直购管状意大利面，‍美味口感，20分钟简餐，美味源自不添加，Q弹爽滑，口感劲道，耐煮不黏连，滋滋美味，念念不忘。\n', 1538087966, 1538207534);
INSERT INTO `ts_group_product` VALUES (241, 234, 12, 18, 50, '【吉娜蜂蜜麦片】250克*1包/份', 1, 0, 15.00, 30.00, 23.90, 0, 0, 6, '立陶宛直购，欧盟食品认证，健康膳食，口感香甜，燕麦里富含多种人体所需的膳食纤维，干吃，，牛奶冲泡，享受西式早餐带来的便捷与美味，富含维生素A.维生素D.维生素B1.维生素B2、维生素B6、维生素B12、维生素C等，而且口感香糯美味，黄金营养，吸收更好，补充能量，平衡饮食，易于消化。\n', 1538087966, 1538207534);
