INSERT INTO `ts_group_product` VALUES (275, 240, 12, 20, 44, '【琯溪三红蜜柚】3斤左右*2个/份', 2, 0, 15.00, 30.00, 24.90, 0, 0, 0, '皮红，囊红，肉红，千娇百媚，让你垂涎欲滴，未见其肉，先闻其香，水分充足，唇齿留香，汁多细腻，香甜可口，诱惑红肉，粒粒饱满晶莹。\n', 1538092916, 1538207534);
INSERT INTO `ts_group_product` VALUES (276, 240, 12, 20, 45, '【自家现挖毛芋头】4斤/份', 1, 0, 15.00, 12.00, 9.90, 0, 0, 1, '自己老家的毛芋头，自己种植，自然成熟，不使用任何农药，吃的放心，清香软糯，绵柔软滑，甘甜可口，蒸 炒 炸 炖皆可，我都是香芋炖排骨吃，‍恰到好处的美妙滋味，老少皆宜。\n', 1538092916, 1538207534);
INSERT INTO `ts_group_product` VALUES (277, 240, 12, 20, 46, '【四川安岳黄柠檬】2个*2包/份', 0, 0, 25.00, 13.00, 9.90, 0, 0, 2, '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1538092916, 1538207534);
INSERT INTO `ts_group_product` VALUES (278, 240, 12, 20, 47, '【沾化冬枣】2斤/份', 2, 0, 10.00, 12.00, 9.90, 0, 0, 3, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1538092916, 1538207534);
