INSERT INTO `ts_group_product` VALUES (303, 235, 12, 21, 52, '【进口奶油夹心威化球】花生味 300克*1包/份', 0, 0, 12.00, 38.00, 29.90, 0, 0, 8, '波兰直购，欧盟食品认证，奶油夹心花生酥威化球，伴着淡淡的香气，甜滑爽口，酥脆柔滑奇妙结合，丝滑奶油，香浓花生，甜而不腻，回味无穷，源自波兰美味。\n', 1538100233, 1538207534);
INSERT INTO `ts_group_product` VALUES (304, 235, 12, 21, 53, '【香港百贝滋鲜鸡蛋卷】蟹黄味 2包/份', 0, 0, 18.00, 25.00, 19.90, 0, 0, 9, '网红蛋卷系列，放心 安心 良心，把快乐传递，将快乐分享，原蛋手打，严选细作，看得见的黑芝麻，闻得到的鸡蛋味，酥脆浓香，轻咬酥脆溶于口，口感清新不油腻，酥，脆，香，传统手工制作。\n', 1538100233, 1538207534);
INSERT INTO `ts_group_product` VALUES (305, 235, 12, 21, 54, '【香港百贝滋鲜鸡蛋卷】芝麻味 2包/份', 0, 0, 18.00, 25.00, 19.90, 0, 0, 10, '网红蛋卷系列，放心 安心 良心，把快乐传递，将快乐分享，原蛋手打，‍严选细作，看得见的黑芝麻，闻得到的鸡蛋味，酥脆浓香，轻咬酥脆溶于口，口感清新不油腻，酥，脆，香，传统手工制作。\n', 1538100233, 1538207534);
INSERT INTO `ts_group_product` VALUES (306, 235, 12, 21, 55, '【古早手工蛋糕】2个/份', 0, 0, 18.00, 12.00, 9.90, 0, 0, 11, '好品质源自好食材，卖相很Q，抵挡不住的美味诱惑，和牛奶一起吃，更好吃哦，金黄饱满，香浓软糯，吃起来奶香味浓，如云朵般轻盈软润的口感，入口即化，香味自然，‍传统手工艺制作。\n', 1538100233, 1538207534);
INSERT INTO `ts_group_product` VALUES (307, 235, 12, 21, 56, '【思念小油条】 23根/袋 过油加热后食用', 0, 0, 10.00, 26.00, 19.90, 0, 0, 12, '国人传统风味，美味健康，精选优质小麦粉，口感极佳。\n色泽金黄，香气扑鼻，外层金黄酥脆，内层柔软白嫩，纯手工 工艺，无铅膨松剂，品味记忆里最熟悉的味道，\n早餐快捷制作，营养丰富，适合高品质快节奏生活，香浓可口，营养健康，带给你至高的早餐享受。', 1538100233, 1538207534);
INSERT INTO `ts_group_product` VALUES (308, 235, 12, 21, 57, '【冰雪皇后芝麻夹心海苔】4克*10小包*2包/份', 0, 0, 10.00, 18.00, 14.90, 0, 0, 13, '真正的夹心海苔，做到真正的鲜 香 脆！片片饱满的芝麻，铺在香酥的双面海苔上。香 酥 脆的优质口感，富含多重营养成分！满满的芝麻，非油炸更健康。保质期12个月，开袋即食。\n', 1538100233, 1538207534);
INSERT INTO `ts_group_product` VALUES (309, 235, 12, 21, 58, '【西班牙原装进口橄榄油】250ml*1瓶/份', 0, 0, 10.00, 36.00, 28.80, 0, 0, 14, '伯爵品质 经典传承，油中贵族，口服，凉拌，清炒，蒸饭，做汤，煎炸，烧烤， 蘸食，护肤均可使用，‍橄榄油被认为是迄今发现的油脂中最适合人体营养的油脂，具有活血化瘀，降压降脂，美容养颜，健脑益智，长期食用还可以提高记忆力和抵抗力。\n', 1538100233, 1538207534);
INSERT INTO `ts_group_product` VALUES (310, 235, 12, 21, 59, '【得利斯奶黄包】 12个*2袋/份', 0, 0, 10.00, 18.00, 11.80, 0, 0, 15, '优选小麦粉，弹滑面皮不粘牙，入口香甜软绵，舌尖味蕾悠然舒展。\n小小个造型，香甜软绵。\n用心挑选，自然与汗水的结晶，造就美味食品，免去繁琐制作过程，加热即可，美味即成。', 1538100233, 1538207534);
