INSERT INTO `ts_group_product` VALUES (342, 656, 12, 22, 44, '【琯溪三红蜜柚】3斤左右*2个/份', 1, 0, 15.00, 30.00, 24.90, 0, 0, 0, '皮红，囊红，肉红，千娇百媚，让你垂涎欲滴，未见其肉，先闻其香，水分充足，唇齿留香，汁多细腻，香甜可口，诱惑红肉，粒粒饱满晶莹。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (343, 656, 12, 22, 45, '【自家现挖毛芋头】4斤/份', 1, 0, 15.00, 12.00, 9.90, 0, 0, 1, '自己老家的毛芋头，自己种植，自然成熟，不使用任何农药，吃的放心，清香软糯，绵柔软滑，甘甜可口，蒸 炒 炸 炖皆可，我都是香芋炖排骨吃，‍恰到好处的美妙滋味，老少皆宜。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (344, 656, 12, 22, 46, '【四川安岳黄柠檬】2个*2包/份', 0, 0, 25.00, 13.00, 9.90, 0, 0, 2, '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (345, 656, 12, 22, 47, '【沾化冬枣】2斤/份', 1, 0, 10.00, 12.00, 9.90, 0, 0, 3, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (346, 656, 12, 22, 48, '【FRUGO 100%苹果汁】250ML*2瓶/份', 0, 0, 15.00, 15.00, 9.90, 0, 0, 4, '波兰原瓶原装直购，百分百纯苹果汁，维生素C丰富，可增强人体抵抗力和机体的解毒功能，苹果汁是美容佳品，既减肥又能让皮肤润滑柔嫩，苹果中还有铜，碘，锰，锌，钾等元素，补充人体所需营养物质。无添加剂，百分百原汁。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (347, 656, 12, 22, 49, '【圣塔索菲亚 管状意大利面】500克*1包/份', 0, 0, 10.00, 15.00, 10.90, 0, 0, 5, '土耳其直购管状意大利面，‍美味口感，20分钟简餐，美味源自不添加，Q弹爽滑，口感劲道，耐煮不黏连，滋滋美味，念念不忘。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (348, 656, 12, 22, 50, '【吉娜蜂蜜麦片】250克*1包/份', 0, 0, 15.00, 30.00, 23.90, 0, 0, 6, '立陶宛直购，欧盟食品认证，健康膳食，口感香甜，燕麦里富含多种人体所需的膳食纤维，干吃，，牛奶冲泡，享受西式早餐带来的便捷与美味，富含维生素A.维生素D.维生素B1.维生素B2、维生素B6、维生素B12、维生素C等，而且口感香糯美味，黄金营养，吸收更好，补充能量，平衡饮食，易于消化。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (349, 656, 12, 22, 51, '【进口奶油夹心威化球】椰子味 300克*1包/份', 0, 0, 12.00, 38.00, 29.90, 0, 0, 7, '波兰直购，欧盟食品认证，奶油夹心花生酥威化球，伴着淡淡的香气，甜滑爽口，酥脆柔滑奇妙结合，丝滑奶油，香浓花生，甜而不腻，回味无穷，源自波兰美味。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (350, 656, 12, 22, 52, '【进口奶油夹心威化球】花生味 300克*1包/份', 0, 0, 12.00, 38.00, 29.90, 0, 0, 8, '波兰直购，欧盟食品认证，奶油夹心花生酥威化球，伴着淡淡的香气，甜滑爽口，酥脆柔滑奇妙结合，丝滑奶油，香浓花生，甜而不腻，回味无穷，源自波兰美味。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (351, 656, 12, 22, 53, '【香港百贝滋鲜鸡蛋卷】蟹黄味 2包/份', 0, 0, 18.00, 25.00, 19.90, 0, 0, 9, '网红蛋卷系列，放心 安心 良心，把快乐传递，将快乐分享，原蛋手打，严选细作，看得见的黑芝麻，闻得到的鸡蛋味，酥脆浓香，轻咬酥脆溶于口，口感清新不油腻，酥，脆，香，传统手工制作。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (352, 656, 12, 22, 54, '【香港百贝滋鲜鸡蛋卷】芝麻味 2包/份', 0, 0, 18.00, 25.00, 19.90, 0, 0, 10, '网红蛋卷系列，放心 安心 良心，把快乐传递，将快乐分享，原蛋手打，‍严选细作，看得见的黑芝麻，闻得到的鸡蛋味，酥脆浓香，轻咬酥脆溶于口，口感清新不油腻，酥，脆，香，传统手工制作。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (353, 656, 12, 22, 55, '【古早手工蛋糕】2个/份', 0, 0, 18.00, 12.00, 9.90, 0, 0, 11, '好品质源自好食材，卖相很Q，抵挡不住的美味诱惑，和牛奶一起吃，更好吃哦，金黄饱满，香浓软糯，吃起来奶香味浓，如云朵般轻盈软润的口感，入口即化，香味自然，‍传统手工艺制作。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (354, 656, 12, 22, 56, '【思念小油条】 23根/袋 过油加热后食用', 1, 0, 10.00, 26.00, 19.90, 0, 0, 12, '国人传统风味，美味健康，精选优质小麦粉，口感极佳。\n色泽金黄，香气扑鼻，外层金黄酥脆，内层柔软白嫩，纯手工 工艺，无铅膨松剂，品味记忆里最熟悉的味道，\n早餐快捷制作，营养丰富，适合高品质快节奏生活，香浓可口，营养健康，带给你至高的早餐享受。', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (355, 656, 12, 22, 57, '【冰雪皇后芝麻夹心海苔】4克*10小包*2包/份', 0, 0, 10.00, 18.00, 14.90, 0, 0, 13, '真正的夹心海苔，做到真正的鲜 香 脆！片片饱满的芝麻，铺在香酥的双面海苔上。香 酥 脆的优质口感，富含多重营养成分！满满的芝麻，非油炸更健康。保质期12个月，开袋即食。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (356, 656, 12, 22, 58, '【西班牙原装进口橄榄油】250ml*1瓶/份', 0, 0, 10.00, 36.00, 28.80, 0, 0, 14, '伯爵品质 经典传承，油中贵族，口服，凉拌，清炒，蒸饭，做汤，煎炸，烧烤， 蘸食，护肤均可使用，‍橄榄油被认为是迄今发现的油脂中最适合人体营养的油脂，具有活血化瘀，降压降脂，美容养颜，健脑益智，长期食用还可以提高记忆力和抵抗力。\n', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (357, 656, 12, 22, 59, '【得利斯奶黄包】 12个*2袋/份', 0, 0, 10.00, 18.00, 11.80, 0, 0, 15, '优选小麦粉，弹滑面皮不粘牙，入口香甜软绵，舌尖味蕾悠然舒展。\n小小个造型，香甜软绵。\n用心挑选，自然与汗水的结晶，造就美味食品，免去繁琐制作过程，加热即可，美味即成。', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (358, 656, 12, 22, 60, '【思念2.25kg手抓饼】原味 25片*1盒/份', 0, 0, 10.00, 35.00, 29.90, 0, 0, 16, '营养早餐必备，吃过都说好！', 1538204061, 1538207534);
