INSERT INTO `ts_group_product` VALUES (360, 656, 12, 22, 62, '【泰国青草药膏(卧佛牌)】1瓶*50克/份', 0, 0, 7.00, 18.00, 15.00, 0, 0, 18, '来自泰国，血统纯正，针对蚊虫叮咬，肌肉酸痛，筋骨扭伤，青紫瘀伤，关节痛，感冒，N种功效，一瓶解决，质保期3年，天然配方，樟脑.肉桂油.薄荷油.薄荷醇.雄性.雌性，健康安全，玉菩药堂手工制造，居家必备。', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (361, 656, 12, 22, 63, '【泰国青草药膏(卧佛牌)】3瓶*50克/份 赠一瓶15克', 0, 0, 7.00, 55.00, 45.00, 0, 0, 19, '来自泰国，血统纯正，针对蚊虫叮咬，肌肉酸痛，筋骨扭伤，青紫瘀伤，关节痛，感冒，N种功效，一瓶解决，质保期3年，天然配方，樟脑.肉桂油.薄荷油.薄荷醇.雄性.雌性，健康安全，玉菩药堂手工制造，居家必备。', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (362, 656, 12, 22, 64, '【突尼斯石榴】1个/份', 4, 0, 0.00, 5.00, 1.00, 0, 1, 20, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1538204061, 1538207534);
INSERT INTO `ts_group_product` VALUES (363, 656, 12, 22, 65, '【新疆吐鲁番西州蜜 哈密瓜】1个/份 4斤左右', 2, 0, 12.00, 8.00, 5.00, 0, 0, 21, '来自火焰山的甜蜜问候。唤醒你的味觉！\n甘甜可口 肉质细嫩，果肉越靠近中心处甜度越高，清脆爽口，汁多且无渣，清香四溢。', 1538204061, 1538207535);
