INSERT INTO `ts_group_product` VALUES (434, 239, 19, 26, 97, '【大凉山石榴】1个/份', 4, 0, 0.00, 5.00, 1.00, 0, 1, 16, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1538691336, 1538796498);
INSERT INTO `ts_group_product` VALUES (435, 240, 19, 27, 79, '【砀山梨】5斤/份', 1, 0, 12.00, 15.00, 9.90, 0, 0, 0, '皮薄细腻无渣，酥脆清甜，充足的水分，自然生长的香甜，一口咬下去满口流汁的畅爽。\n轻嚼满嘴甜汁，啖之清甜留香', 1538693042, 1538796497);
INSERT INTO `ts_group_product` VALUES (436, 240, 19, 27, 80, '【琯溪三红蜜柚】3斤左右*2个/份', 4, 0, 15.00, 30.00, 24.90, 0, 0, 1, '皮红，囊红，肉红，千娇百媚，让你垂涎欲滴，未见其肉，先闻其香，水分充足，唇齿留香，汁多细腻，香甜可口，诱惑红肉，粒粒饱满晶莹。\n', 1538693042, 1538796497);
INSERT INTO `ts_group_product` VALUES (437, 240, 19, 27, 81, '【四川安岳黄柠檬】2个*2包/份', 0, 0, 25.00, 13.00, 9.90, 0, 0, 2, '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1538693042, 1538796497);
INSERT INTO `ts_group_product` VALUES (438, 240, 19, 27, 82, '【江西南丰贡桔】2斤/份', 0, 0, 20.00, 15.00, 9.90, 0, 0, 3, '果肉细腻，个小心甜，皮薄肉嫩，爽口化渣，橘香浓郁，柔软多汁，风味浓甜，小小果实，大大营养，维生素C含量特别高，维生素P，可溶性纤维，果酸，氨基酸，爱美的MM都爱哦，南丰蜜桔素有贡品之称。', 1538693042, 1538796497);
INSERT INTO `ts_group_product` VALUES (439, 240, 19, 27, 83, '【大荔冬枣】2斤/份', 0, 0, 10.00, 12.00, 9.90, 0, 0, 4, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1538693042, 1538796497);
INSERT INTO `ts_group_product` VALUES (440, 240, 19, 27, 84, '【自家现挖毛芋头】4斤/份', 1, 0, 15.00, 12.00, 9.90, 0, 0, 5, '自己老家的毛芋头，自己种植，自然成熟，不使用任何农药，吃的放心，清香软糯，绵柔软滑，甘甜可口，蒸 炒 炸 炖皆可，我都是香芋炖排骨吃，‍恰到好处的美妙滋味，老少皆宜。\n', 1538693042, 1538796498);
INSERT INTO `ts_group_product` VALUES (441, 240, 19, 27, 85, '【湘西富硒米良猕猴桃】8个/份', 1, 0, 10.00, 15.00, 9.90, 0, 0, 6, '让鲜甜挑逗你的味蕾，让美味在舌尖上跳舞，果肉翠绿，味道酸甜可口，有浓厚的清香味，维生素含量高，一口下去，呲 的 环绕整个味蕾，清甜而不腻。', 1538693042, 1538796498);
INSERT INTO `ts_group_product` VALUES (442, 240, 19, 27, 86, '【冰雪皇后芝麻夹心海苔】4克*10小包*2包/份', 0, 0, 10.00, 18.00, 14.90, 0, 0, 7, '真正的夹心海苔，做到真正的鲜 香 脆！片片饱满的芝麻，铺在香酥的双面海苔上。香 酥 脆的优质口感，富含多重营养成分！满满的芝麻，非油炸更健康。保质期12个月，开袋即食。\n', 1538693042, 1538796498);
INSERT INTO `ts_group_product` VALUES (443, 240, 19, 27, 87, '【80食堂酸辣粉】140克*2盒', 0, 0, 10.00, 18.00, 14.90, 0, 0, 8, '80食堂酸辣粉，大街小巷小馆子的童年老味道。红薯粉丝，品质更高。香滑细嫩，缠绵清爽！秘制椒香，红油辣子采用多种味料精心炒制而成，麻辣鲜香！陈年食醋，与红油辣子一同构成酸辣鲜爽的馋人味道！秘制料，熟花生，香脆鲜香，一包料，让汤更鲜美！美味豆皮，劲道有力，在粉丝缠绵口感之外，增加咀嚼', 1538693042, 1538796498);
INSERT INTO `ts_group_product` VALUES (444, 240, 19, 27, 88, '【马来西亚mini奥利奥】原味、草莓各一包', 0, 0, 12.00, 35.00, 24.90, 0, 0, 9, '融入法式浪漫，时刻定制你的美味', 1538693042, 1538796498);
INSERT INTO `ts_group_product` VALUES (445, 240, 19, 27, 89, '【古早手工蛋糕】2个/份', 0, 0, 18.00, 12.00, 9.90, 0, 0, 10, '好品质源自好食材，卖相很Q，抵挡不住的美味诱惑，和牛奶一起吃，更好吃哦，金黄饱满，香浓软糯，吃起来奶香味浓，如云朵般轻盈软润的口感，入口即化，香味自然，‍传统手工艺制作。\n', 1538693042, 1538796498);
INSERT INTO `ts_group_product` VALUES (446, 240, 19, 27, 90, '【FRUGO 100%苹果汁】250ML*2瓶/份', 0, 0, 15.00, 15.00, 9.90, 0, 0, 11, '波兰原瓶原装直购，百分百纯苹果汁，维生素C丰富，可增强人体抵抗力和机体的解毒功能，苹果汁是美容佳品，既减肥又能让皮肤润滑柔嫩，苹果中还有铜，碘，锰，锌，钾等元素，补充人体所需营养物质。无添加剂，百分百原汁。\n', 1538693042, 1538796498);
INSERT INTO `ts_group_product` VALUES (447, 240, 19, 27, 91, '【新西进口 板栗南瓜】1个/份', 0, 0, 14.00, 15.00, 9.90, 0, 0, 12, '板栗南瓜 丰富的VA，β葫萝卜素和膳食纤维，尤其是胡萝卜素含量极其高，可用于断奶食物的制作，是做宝宝食物的好材料，板栗口感，肉细嫩紧实，甜糯，糯软润滑，大火蒸30分钟即可，蒸熟后瓜皮瓜肉皆可食用。', 1538693042, 1538796498);
INSERT INTO `ts_group_product` VALUES (448, 240, 19, 27, 94, '【印尼原装进口猫屎咖啡盒装】15克*5条', 0, 0, 10.00, 35.00, 27.00, 0, 0, 13, '印尼麝香猫咖啡是种咖啡豆，产自印尼苏门答腊亚崎山区，苏门答腊岛是是麝香猫咖啡的故乡。印度尼西亚山间有一种名叫路哇克(Luwak)的麝香猫喜欢吃多浆的咖啡果子，但坚硬的咖啡种籽无法消化，随粪便排出，印度尼西亚人发觉经过麝香猫肠胃发酵的咖啡豆，浓稠香醇，于是搜集麝香猫排泄物，筛滤出咖啡豆泡煮来喝，就这样做出了麝香猫咖啡。麝香猫 猫屎风味 它的风味浓郁 香 苦 醇厚！', 1538693042, 1538796498);
INSERT INTO `ts_group_product` VALUES (449, 240, 19, 27, 95, '【玛俪娅 提拉米苏六寸】1个/份 抹茶味 ', 0, 0, 10.00, 20.00, 15.90, 0, 0, 14, '匠心独运，相约相恋，奶油提拉米苏，惬意享受，悠闲时光，尽情享受快乐的每一秒，新鲜奶源，‍新鲜鸡蛋，进口面粉，精选蜂蜜，纯手工制作，自然回软，口感丰富。\n', 1538693042, 1538796498);
