INSERT INTO `ts_group_product` VALUES (533, 221, 19, 32, 94, '【印尼原装进口猫屎咖啡盒装】15克*5条', 0, 0, 10.00, 35.00, 27.00, 0, 0, 13, '印尼麝香猫咖啡是种咖啡豆，产自印尼苏门答腊亚崎山区，苏门答腊岛是是麝香猫咖啡的故乡。印度尼西亚山间有一种名叫路哇克(Luwak)的麝香猫喜欢吃多浆的咖啡果子，但坚硬的咖啡种籽无法消化，随粪便排出，印度尼西亚人发觉经过麝香猫肠胃发酵的咖啡豆，浓稠香醇，于是搜集麝香猫排泄物，筛滤出咖啡豆泡煮来喝，就这样做出了麝香猫咖啡。麝香猫 猫屎风味 它的风味浓郁 香 苦 醇厚！', 1538701672, 1538796498);
