INSERT INTO `ts_group_product` VALUES (569, 227, 21, 35, 118, '【六合无骨鸡柳】2斤*1袋', 0, 0, 10.00, 25.00, 19.90, 0, 0, 8, '让你的味蕾来跳舞，油炸后‍回味悠长，更是带着美味扑鼻的香气，口感松脆鲜香，嫩滑香脆，搭配番茄酱吃到嘴里味道甜美，外皮酥嫩，色泽金黄，气味鲜香诱人，口感饱满嫩滑而富有弹性。', 1538919495, 1538919495);
INSERT INTO `ts_group_product` VALUES (570, 227, 21, 35, 119, '【思念小油条】 23根/袋 过油加热后食用', 0, 0, 10.00, 26.00, 19.90, 0, 0, 9, '国人传统风味，美味健康，精选优质小麦粉，口感极佳。\n色泽金黄，香气扑鼻，外层金黄酥脆，内层柔软白嫩，纯手工 工艺，无铅膨松剂，品味记忆里最熟悉的味道，\n早餐快捷制作，营养丰富，适合高品质快节奏生活，香浓可口，营养健康，带给你至高的早餐享受。', 1538919495, 1538919495);
INSERT INTO `ts_group_product` VALUES (571, 227, 21, 35, 120, '【六合香辣肉排】2斤*1袋/份', 0, 0, 10.00, 25.00, 19.90, 0, 0, 10, '上班下班休闲娱乐你需要肉排来提升你的味觉，\n酥香可口，肉质细腻，🏻‍美味可口，好味道，好色相，好口感，好营养。', 1538919495, 1538919495);
INSERT INTO `ts_group_product` VALUES (572, 227, 21, 35, 121, '【吉娜蜂蜜麦片】250克*1包/份', 0, 0, 15.00, 30.00, 23.90, 0, 0, 11, '立陶宛直购，欧盟食品认证，健康膳食，口感香甜，燕麦里富含多种人体所需的膳食纤维，干吃，，牛奶冲泡，享受西式早餐带来的便捷与美味，富含维生素A.维生素D.维生素B1.维生素B2、维生素B6、维生素B12、维生素C等，而且口感香糯美味，黄金营养，吸收更好，补充能量，平衡饮食，易于消化。\n', 1538919495, 1538919495);
INSERT INTO `ts_group_product` VALUES (573, 234, 21, 36, 110, '【芳柔伊手帕纸】6小包/份', 0, 0, 0.00, 5.00, 3.00, 0, 0, 0, '本色竹浆返璞归真，原色纸 不漂白，自然更安全，四层加厚柔韧无添加，🎊无尘屑，无荧光剂，湿水不易破，💫给您优质的健康生活。', 1538926098, 1538926098);
INSERT INTO `ts_group_product` VALUES (574, 234, 21, 36, 111, '【新鲜采摘自家山楂】2斤/份', 0, 0, 20.00, 15.00, 9.90, 0, 0, 1, '酸酸甜甜就是我，酸甜软糯，无农药不洗直接吃，🎊山楂含有酒石酸，柠檬酸，果糖，维生素C，维生素B，尼克酸，钙铁硒，黄酮类等营养成分，其中维C的含量在水果中仅次于红枣和猕猴桃，胡萝卜素和钙的含量也很高。', 1538926098, 1538926098);
INSERT INTO `ts_group_product` VALUES (575, 234, 21, 36, 112, '【海南丝路晓蜜】1个/份', 0, 0, 15.00, 26.00, 19.90, 0, 0, 2, '海南晓蜜蜜瓜，光照时间长，甜度高，味甜如蜜，🎊肉质细腻金黄，香甜清脆，甜如初恋，水分很足，皮很薄，甜度高于一般的哈密，深受果粉的喜爱。', 1538926098, 1538926098);
INSERT INTO `ts_group_product` VALUES (576, 234, 21, 36, 113, '【湘西富硒米良猕猴桃】8个/份', 0, 0, 10.00, 15.00, 9.90, 0, 0, 3, '让鲜甜挑逗你的味蕾，让美味在舌尖上跳舞，果肉翠绿，味道酸甜可口，有浓厚的清香味，维生素含量高，一口下去，呲 的 环绕整个味蕾，清甜而不腻。', 1538926099, 1538926099);
INSERT INTO `ts_group_product` VALUES (577, 234, 21, 36, 114, '【四川安岳黄柠檬】2个*2包/份', 1, 0, 25.00, 13.00, 9.90, 0, 0, 4, '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1538926099, 1538926099);
INSERT INTO `ts_group_product` VALUES (578, 234, 21, 36, 115, '【超细纤维毛巾】2条/份', 0, 0, 20.00, 16.00, 9.90, 0, 0, 5, '不掉毛，🎊不掉色 ，不抽丝 ，不脱圈 ，强吸水性，不留痕迹，💫强力吸尘不留痕迹，🎊超细纤维，亲肤柔软，厨房.客厅.擦车必备利器。', 1538926099, 1538926099);
