INSERT INTO `ts_group_product` VALUES (639, 238, 21, 41, 116, '【粉丝扇贝(蒜蓉味)】10个*1包/份', 0, 0, 10.00, 30.00, 19.90, 0, 0, 6, '新鲜加工，蒜香浓郁，鲜美细腻，肉质劲道，💫贝肉肥嫩，嫩滑细腻有弹性，🏻‍蒜泥配比匠心调制，鲜美细腻，🎊优质绿豆粉丝，口感嫩滑，好吃不长肉，夜宵伴侣。', 1538953024, 1538953024);
INSERT INTO `ts_group_product` VALUES (640, 238, 21, 41, 117, '【喜世牛肉饼】10个*1袋/份', 2, 0, 10.00, 26.00, 23.80, 0, 0, 7, '鲜香多汁，美味可口，入口香酥，肉香四溢，香而不腻，风味独特，外焦里嫩，‍回味悠长。\n', 1538953024, 1538953024);
INSERT INTO `ts_group_product` VALUES (641, 238, 21, 41, 118, '【六合无骨鸡柳】2斤*1袋', 1, 0, 10.00, 25.00, 19.90, 0, 0, 8, '让你的味蕾来跳舞，油炸后‍回味悠长，更是带着美味扑鼻的香气，口感松脆鲜香，嫩滑香脆，搭配番茄酱吃到嘴里味道甜美，外皮酥嫩，色泽金黄，气味鲜香诱人，口感饱满嫩滑而富有弹性。', 1538953024, 1538953024);
INSERT INTO `ts_group_product` VALUES (642, 238, 21, 41, 119, '【思念小油条】 23根/袋 过油加热后食用', 0, 0, 10.00, 26.00, 19.90, 0, 0, 9, '国人传统风味，美味健康，精选优质小麦粉，口感极佳。\n色泽金黄，香气扑鼻，外层金黄酥脆，内层柔软白嫩，纯手工 工艺，无铅膨松剂，品味记忆里最熟悉的味道，\n早餐快捷制作，营养丰富，适合高品质快节奏生活，香浓可口，营养健康，带给你至高的早餐享受。', 1538953024, 1538953024);
INSERT INTO `ts_group_product` VALUES (643, 238, 21, 41, 120, '【六合香辣肉排】2斤*1袋/份', 0, 0, 10.00, 25.00, 19.90, 0, 0, 10, '上班下班休闲娱乐你需要肉排来提升你的味觉，\n酥香可口，肉质细腻，🏻‍美味可口，好味道，好色相，好口感，好营养。', 1538953024, 1538953024);
INSERT INTO `ts_group_product` VALUES (644, 238, 21, 41, 121, '【吉娜蜂蜜麦片】250克*1包/份', 0, 0, 15.00, 30.00, 23.90, 0, 0, 11, '立陶宛直购，欧盟食品认证，健康膳食，口感香甜，燕麦里富含多种人体所需的膳食纤维，干吃，，牛奶冲泡，享受西式早餐带来的便捷与美味，富含维生素A.维生素D.维生素B1.维生素B2、维生素B6、维生素B12、维生素C等，而且口感香糯美味，黄金营养，吸收更好，补充能量，平衡饮食，易于消化。\n', 1538953024, 1538953024);
INSERT INTO `ts_group_product` VALUES (645, 237, 21, 42, 110, '【芳柔伊手帕纸】6小包/份', 0, 0, 0.00, 5.00, 3.00, 0, 0, 0, '本色竹浆返璞归真，原色纸 不漂白，自然更安全，四层加厚柔韧无添加，🎊无尘屑，无荧光剂，湿水不易破，💫给您优质的健康生活。', 1538954025, 1538954025);
INSERT INTO `ts_group_product` VALUES (646, 237, 21, 42, 111, '【新鲜采摘自家山楂】2斤/份', 0, 0, 20.00, 15.00, 9.90, 0, 0, 1, '酸酸甜甜就是我，酸甜软糯，无农药不洗直接吃，🎊山楂含有酒石酸，柠檬酸，果糖，维生素C，维生素B，尼克酸，钙铁硒，黄酮类等营养成分，其中维C的含量在水果中仅次于红枣和猕猴桃，胡萝卜素和钙的含量也很高。', 1538954025, 1538954025);
INSERT INTO `ts_group_product` VALUES (647, 237, 21, 42, 112, '【海南丝路晓蜜】1个/份', 0, 0, 15.00, 26.00, 19.90, 0, 0, 2, '海南晓蜜蜜瓜，光照时间长，甜度高，味甜如蜜，🎊肉质细腻金黄，香甜清脆，甜如初恋，水分很足，皮很薄，甜度高于一般的哈密，深受果粉的喜爱。', 1538954025, 1538954025);
