INSERT INTO `ts_header_group_product` VALUES (1, 1, 7, 92, '【突尼斯石榴】1个/份', -1, 3, 0, 0.00, 1.00, 5.00, 1.00, 0, 1, 0, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1537875979, 1537877341);
INSERT INTO `ts_header_group_product` VALUES (2, 1, 7, 93, '【海南紫水晶红心火龙果】4个/份 ', -1, 0, 0, 15.00, 10.00, 25.00, 19.90, 0, 0, 1, '紫水晶红心火龙果的糖分达20°以上，味儿，口感特甜，个大饱满中间圆润并凸起，果皮外像鳞一样一片片外翻为上品，', 1537875979, 1537876005);
INSERT INTO `ts_header_group_product` VALUES (9, 1, 8, 92, '【突尼斯石榴】1个/份', -1, 155, 1, 0.00, 1.00, 5.00, 1.00, 0, 1, 0, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1537885986, 1538041718);
INSERT INTO `ts_header_group_product` VALUES (11, 1, 8, 94, '【新疆吐鲁番西州蜜 哈密瓜】1个/份 4斤左右', -1, 99, 2, 12.00, 3.50, 8.00, 5.00, 0, 0, 1, '来自火焰山的甜蜜问候。唤醒你的味觉！\n甘甜可口 肉质细嫩，果肉越靠近中心处甜度越高，清脆爽口，汁多且无渣，清香四溢。', 1537885986, 1538042269);
INSERT INTO `ts_header_group_product` VALUES (16, 1, 8, 93, '【海南紫水晶红心火龙果】4个/份 ', -1, 40, 1, 20.00, 12.00, 25.00, 19.90, 0, 0, 2, '紫水晶红心火龙果的糖分达20°以上，味儿，口感特甜，个大饱满中间圆润并凸起，果皮外像鳞一样一片片外翻为上品，而且捏起来有一点点软的这样的会超级好吃，爆汁的甜，不甜不要钱，我敢这样说。\n特别说明：皮皱，叶鳞发黑，是它在树上就长成这样，因为这款紫水晶皮薄，受到北纬18°的高温炙烤，造成皱皮，叶鳞枯萎，但果肉相反甜到爆，是这款紫水晶火龙果的标志。\n', 1537886877, 1538042269);
INSERT INTO `ts_header_group_product` VALUES (17, 1, 8, 91, '【自家山核桃】5斤/份', -1, 6, 0, 10.00, 15.00, 25.00, 19.90, 0, 0, 4, '自己家里的山核桃，无水洗，不漂白，更健康，原滋原味，果仁吃起来 脆嫩香甜，带着淡淡的核桃香。\n', 1537886877, 1538041517);
INSERT INTO `ts_header_group_product` VALUES (18, 1, 8, 95, '【无淀粉肉肠】10根/份', -1, 20, 0, 10.00, 14.00, 25.00, 19.00, 0, 0, 5, '无淀粉全肉肠，满口留香，劲道口感，手抓饼好搭档。微波炉加热食用。\n', 1537886877, 1538019199);
INSERT INTO `ts_header_group_product` VALUES (19, 1, 8, 104, '【喜世牛肉饼】10个*1袋/份', -1, 7, 0, 10.00, 10.00, 26.00, 23.80, 0, 0, 6, '鲜香多汁，美味可口，入口香酥，肉香四溢，香而不腻，风味独特，外焦里嫩，‍回味悠长。\n', 1537886877, 1538036081);
INSERT INTO `ts_header_group_product` VALUES (20, 1, 8, 108, '【80食堂酸辣粉】140克*2盒', -1, 9, 0, 10.00, 11.40, 18.00, 14.90, 0, 0, 7, '80食堂酸辣粉，大街小巷小馆子的童年老味道。红薯粉丝，品质更高。香滑细嫩，缠绵清爽！秘制椒香，红油辣子采用多种味料精心炒制而成，麻辣鲜香！陈年食醋，与红油辣子一同构成酸辣鲜爽的馋人味道！秘制料，熟花生，香脆鲜香，一包料，让汤更鲜美！美味豆皮，劲道有力，在粉丝缠绵口感之外，增加咀嚼', 1537888788, 1538019199);
INSERT INTO `ts_header_group_product` VALUES (21, 1, 8, 109, '【五香花卷】 60个/带', -1, 5, 0, 10.00, 15.00, 22.00, 18.90, 0, 0, 8, '乡间石磨小麦粉，整粒麦的营养都在里面，吃起来粮食味浓郁醇香。\n童年是梦 是诗，让人慢慢品味，顽皮的我们，喜欢课堂背着老师偷偷分享，喜欢揪着女同学的长发，喜欢……儿时的味道，怀念就把它带回家吧', 1537889357, 1538027619);
INSERT INTO `ts_header_group_product` VALUES (23, 1, 8, 111, '【六合无骨鸡柳】2斤*1袋', -1, 2, 0, 10.00, 16.00, 25.00, 19.90, 0, 0, 9, '让你的味蕾来跳舞，油炸后‍回味悠长，更是带着美味扑鼻的香气，口感松脆鲜香，嫩滑香脆，搭配番茄酱吃到嘴里味道甜美，外皮酥嫩，色泽金黄，气味鲜香诱人，口感饱满嫩滑而富有弹性。', 1537889663, 1537976476);
INSERT INTO `ts_header_group_product` VALUES (24, 1, 8, 112, '【沾化冬枣】2斤/份', -1, 32, 2, 10.00, 7.60, 12.00, 9.90, 0, 0, 3, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1537890077, 1538042269);
INSERT INTO `ts_header_group_product` VALUES (25, 1, 8, 113, '【泰国青草药膏(卧佛牌)】1瓶*50克/份', -1, 1, 1, 7.00, 12.70, 18.00, 15.00, 0, 0, 10, '来自泰国，血统纯正，针对蚊虫叮咬，肌肉酸痛，筋骨扭伤，青紫瘀伤，关节痛，感冒，N种功效，一瓶解决，质保期3年，天然配方，樟脑.肉桂油.薄荷油.薄荷醇.雄性.雌性，健康安全，玉菩药堂手工制造，居家必备。', 1537974408, 1538044665);
INSERT INTO `ts_header_group_product` VALUES (26, 1, 8, 114, '【泰国青草药膏(卧佛牌)】3瓶*50克/份 赠一瓶15克', -1, 5, 0, 7.00, 38.00, 55.00, 45.00, 0, 0, 11, '来自泰国，血统纯正，针对蚊虫叮咬，肌肉酸痛，筋骨扭伤，青紫瘀伤，关节痛，感冒，N种功效，一瓶解决，质保期3年，天然配方，樟脑.肉桂油.薄荷油.薄荷醇.雄性.雌性，健康安全，玉菩药堂手工制造，居家必备。', 1537974408, 1538039790);
INSERT INTO `ts_header_group_product` VALUES (44, 1, 12, 118, '【琯溪三红蜜柚】3斤左右*2个/份', -1, 12, 0, 15.00, 17.00, 30.00, 24.90, 0, 0, 0, '皮红，囊红，肉红，千娇百媚，让你垂涎欲滴，未见其肉，先闻其香，水分充足，唇齿留香，汁多细腻，香甜可口，诱惑红肉，粒粒饱满晶莹。\n', 1538064442, 1538213837);
INSERT INTO `ts_header_group_product` VALUES (45, 1, 12, 121, '【自家现挖毛芋头】4斤/份', 12, 23, 0, 15.00, 6.40, 12.00, 9.90, 0, 0, 1, '自己老家的毛芋头，自己种植，自然成熟，不使用任何农药，吃的放心，清香软糯，绵柔软滑，甘甜可口，蒸 炒 炸 炖皆可，我都是香芋炖排骨吃，‍恰到好处的美妙滋味，老少皆宜。\n', 1538064442, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (46, 1, 12, 116, '【四川安岳黄柠檬】2个*2包/份', -1, 5, 0, 25.00, 5.00, 13.00, 9.90, 0, 0, 2, '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1538064442, 1538210637);
INSERT INTO `ts_header_group_product` VALUES (47, 1, 12, 112, '【沾化冬枣】2斤/份', -1, 11, 0, 10.00, 7.60, 12.00, 9.90, 0, 0, 3, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1538064442, 1538211897);
INSERT INTO `ts_header_group_product` VALUES (48, 1, 12, 127, '【FRUGO 100%苹果汁】250ML*2瓶/份', -1, 2, 0, 15.00, 5.00, 15.00, 9.90, 0, 0, 4, '波兰原瓶原装直购，百分百纯苹果汁，维生素C丰富，可增强人体抵抗力和机体的解毒功能，苹果汁是美容佳品，既减肥又能让皮肤润滑柔嫩，苹果中还有铜，碘，锰，锌，钾等元素，补充人体所需营养物质。无添加剂，百分百原汁。\n', 1538064442, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (49, 1, 12, 126, '【圣塔索菲亚 管状意大利面】500克*1包/份', -1, 4, 0, 10.00, 8.00, 15.00, 10.90, 0, 0, 5, '土耳其直购管状意大利面，‍美味口感，20分钟简餐，美味源自不添加，Q弹爽滑，口感劲道，耐煮不黏连，滋滋美味，念念不忘。\n', 1538064442, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (50, 1, 12, 122, '【吉娜蜂蜜麦片】250克*1包/份', -1, 3, 0, 15.00, 16.50, 30.00, 23.90, 0, 0, 6, '立陶宛直购，欧盟食品认证，健康膳食，口感香甜，燕麦里富含多种人体所需的膳食纤维，干吃，，牛奶冲泡，享受西式早餐带来的便捷与美味，富含维生素A.维生素D.维生素B1.维生素B2、维生素B6、维生素B12、维生素C等，而且口感香糯美味，黄金营养，吸收更好，补充能量，平衡饮食，易于消化。\n', 1538064442, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (51, 1, 12, 123, '【进口奶油夹心威化球】椰子味 300克*1包/份', -1, 0, 0, 12.00, 21.80, 38.00, 29.90, 0, 0, 7, '波兰直购，欧盟食品认证，奶油夹心花生酥威化球，伴着淡淡的香气，甜滑爽口，酥脆柔滑奇妙结合，丝滑奶油，香浓花生，甜而不腻，回味无穷，源自波兰美味。\n', 1538064442, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (52, 1, 12, 124, '【进口奶油夹心威化球】花生味 300克*1包/份', -1, 1, 0, 12.00, 21.80, 38.00, 29.90, 0, 0, 8, '波兰直购，欧盟食品认证，奶油夹心花生酥威化球，伴着淡淡的香气，甜滑爽口，酥脆柔滑奇妙结合，丝滑奶油，香浓花生，甜而不腻，回味无穷，源自波兰美味。\n', 1538064442, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (53, 1, 12, 120, '【香港百贝滋鲜鸡蛋卷】蟹黄味 2包/份', -1, 0, 0, 18.00, 12.50, 25.00, 19.90, 0, 0, 9, '网红蛋卷系列，放心 安心 良心，把快乐传递，将快乐分享，原蛋手打，严选细作，看得见的黑芝麻，闻得到的鸡蛋味，酥脆浓香，轻咬酥脆溶于口，口感清新不油腻，酥，脆，香，传统手工制作。\n', 1538064443, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (54, 1, 12, 125, '【香港百贝滋鲜鸡蛋卷】芝麻味 2包/份', -1, 1, 0, 18.00, 12.50, 25.00, 19.90, 0, 0, 10, '网红蛋卷系列，放心 安心 良心，把快乐传递，将快乐分享，原蛋手打，‍严选细作，看得见的黑芝麻，闻得到的鸡蛋味，酥脆浓香，轻咬酥脆溶于口，口感清新不油腻，酥，脆，香，传统手工制作。\n', 1538064443, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (55, 1, 12, 119, '【古早手工蛋糕】2个/份', -1, 5, 0, 18.00, 5.00, 12.00, 9.90, 0, 0, 11, '好品质源自好食材，卖相很Q，抵挡不住的美味诱惑，和牛奶一起吃，更好吃哦，金黄饱满，香浓软糯，吃起来奶香味浓，如云朵般轻盈软润的口感，入口即化，香味自然，‍传统手工艺制作。\n', 1538064443, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (56, 1, 12, 128, '【思念小油条】 23根/袋 过油加热后食用', -1, 3, 0, 10.00, 16.00, 26.00, 19.90, 0, 0, 12, '国人传统风味，美味健康，精选优质小麦粉，口感极佳。\n色泽金黄，香气扑鼻，外层金黄酥脆，内层柔软白嫩，纯手工 工艺，无铅膨松剂，品味记忆里最熟悉的味道，\n早餐快捷制作，营养丰富，适合高品质快节奏生活，香浓可口，营养健康，带给你至高的早餐享受。', 1538064443, 1538212100);
INSERT INTO `ts_header_group_product` VALUES (57, 1, 12, 130, '【冰雪皇后芝麻夹心海苔】4克*10小包*2包/份', -1, 1, 0, 10.00, 12.00, 18.00, 14.90, 0, 0, 13, '真正的夹心海苔，做到真正的鲜 香 脆！片片饱满的芝麻，铺在香酥的双面海苔上。香 酥 脆的优质口感，富含多重营养成分！满满的芝麻，非油炸更健康。保质期12个月，开袋即食。\n', 1538064443, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (58, 1, 12, 129, '【西班牙原装进口橄榄油】250ml*1瓶/份', -1, 0, 0, 10.00, 23.00, 36.00, 28.80, 0, 0, 14, '伯爵品质 经典传承，油中贵族，口服，凉拌，清炒，蒸饭，做汤，煎炸，烧烤， 蘸食，护肤均可使用，‍橄榄油被认为是迄今发现的油脂中最适合人体营养的油脂，具有活血化瘀，降压降脂，美容养颜，健脑益智，长期食用还可以提高记忆力和抵抗力。\n', 1538064443, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (59, 1, 12, 131, '【得利斯奶黄包】 12个*2袋/份', -1, 7, 0, 10.00, 9.60, 18.00, 11.80, 0, 0, 15, '优选小麦粉，弹滑面皮不粘牙，入口香甜软绵，舌尖味蕾悠然舒展。\n小小个造型，香甜软绵。\n用心挑选，自然与汗水的结晶，造就美味食品，免去繁琐制作过程，加热即可，美味即成。', 1538064443, 1538207534);
