INSERT INTO `ts_header_group_product` VALUES (61, 1, 12, 133, '【思念2.25kg手抓饼】葱香味 25片*1盒/份', -1, 6, 2, 10.00, 25.00, 35.00, 29.90, 0, 0, 17, '营养早餐必备，吃过都说好！！', 1538064443, 1538214075);
INSERT INTO `ts_header_group_product` VALUES (62, 1, 12, 113, '【泰国青草药膏(卧佛牌)】1瓶*50克/份', -1, 0, 0, 7.00, 12.70, 18.00, 15.00, 0, 0, 18, '来自泰国，血统纯正，针对蚊虫叮咬，肌肉酸痛，筋骨扭伤，青紫瘀伤，关节痛，感冒，N种功效，一瓶解决，质保期3年，天然配方，樟脑.肉桂油.薄荷油.薄荷醇.雄性.雌性，健康安全，玉菩药堂手工制造，居家必备。', 1538065232, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (63, 1, 12, 114, '【泰国青草药膏(卧佛牌)】3瓶*50克/份 赠一瓶15克', -1, 1, 0, 7.00, 38.00, 55.00, 45.00, 0, 0, 19, '来自泰国，血统纯正，针对蚊虫叮咬，肌肉酸痛，筋骨扭伤，青紫瘀伤，关节痛，感冒，N种功效，一瓶解决，质保期3年，天然配方，樟脑.肉桂油.薄荷油.薄荷醇.雄性.雌性，健康安全，玉菩药堂手工制造，居家必备。', 1538065232, 1538207534);
INSERT INTO `ts_header_group_product` VALUES (64, 1, 12, 92, '【突尼斯石榴】1个/份', 0, 50, 0, 0.00, 1.00, 5.00, 1.00, 0, 1, 20, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1538189801, 1538207901);
INSERT INTO `ts_header_group_product` VALUES (65, 1, 12, 94, '【新疆吐鲁番西州蜜 哈密瓜】1个/份 4斤左右', -1, 20, 0, 12.00, 3.50, 8.00, 5.00, 0, 0, 21, '来自火焰山的甜蜜问候。唤醒你的味觉！\n甘甜可口 肉质细嫩，果肉越靠近中心处甜度越高，清脆爽口，汁多且无渣，清香四溢。', 1538189991, 1538214549);
INSERT INTO `ts_header_group_product` VALUES (66, 1, 12, 93, '【海南紫水晶红心火龙果】2个/份 ', -1, 36, 0, 20.00, 6.00, 12.00, 9.90, 0, 0, 22, '紫水晶红心火龙果的糖分达20°以上，味儿，口感特甜，个大饱满中间圆润并凸起，果皮外像鳞一样一片片外翻为上品，而且捏起来有一点点软的这样的会超级好吃，爆汁的甜，不甜不要钱，我敢这样说。\n特别说明：皮皱，叶鳞发黑，是它在树上就长成这样，因为这款紫水晶皮薄，受到北纬18', 1538199886, 1538213837);
INSERT INTO `ts_header_group_product` VALUES (79, 1, 19, 135, '【砀山梨】5斤/份', 9978, 21, 0, 12.00, 7.00, 15.00, 9.90, 0, 0, 0, '皮薄细腻无渣，酥脆清甜，充足的水分，自然生长的香甜，一口咬下去满口流汁的畅爽。\n轻嚼满嘴甜汁，啖之清甜留香', 1538661862, 1538875643);
INSERT INTO `ts_header_group_product` VALUES (80, 1, 19, 118, '【琯溪三红蜜柚】3斤左右*2个/份', 1, 16, 0, 15.00, 17.00, 30.00, 24.90, 0, 0, 1, '皮红，囊红，肉红，千娇百媚，让你垂涎欲滴，未见其肉，先闻其香，水分充足，唇齿留香，汁多细腻，香甜可口，诱惑红肉，粒粒饱满晶莹。\n', 1538661862, 1538905403);
INSERT INTO `ts_header_group_product` VALUES (81, 1, 19, 116, '【四川安岳黄柠檬】2个*2包/份', -1, 6, 0, 25.00, 5.00, 13.00, 9.90, 0, 0, 2, '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1538661862, 1538901056);
INSERT INTO `ts_header_group_product` VALUES (82, 1, 19, 134, '【江西南丰贡桔】2斤/份', 9978, 21, 0, 20.00, 5.00, 15.00, 9.90, 0, 0, 3, '果肉细腻，个小心甜，皮薄肉嫩，爽口化渣，橘香浓郁，柔软多汁，风味浓甜，小小果实，大大营养，维生素C含量特别高，维生素P，可溶性纤维，果酸，氨基酸，爱美的MM都爱哦，南丰蜜桔素有贡品之称。', 1538661862, 1538902149);
INSERT INTO `ts_header_group_product` VALUES (83, 1, 19, 112, '【大荔冬枣】2斤/份', -1, 9, 0, 10.00, 7.60, 12.00, 9.90, 0, 0, 4, '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1538661862, 1538902149);
INSERT INTO `ts_header_group_product` VALUES (84, 1, 19, 121, '【自家现挖毛芋头】4斤/份', 99998, 13, 0, 15.00, 6.40, 12.00, 9.90, 0, 0, 5, '自己老家的毛芋头，自己种植，自然成熟，不使用任何农药，吃的放心，清香软糯，绵柔软滑，甘甜可口，蒸 炒 炸 炖皆可，我都是香芋炖排骨吃，‍恰到好处的美妙滋味，老少皆宜。\n', 1538661862, 1538799130);
INSERT INTO `ts_header_group_product` VALUES (85, 1, 19, 136, '【湘西富硒米良猕猴桃】8个/份', 9981, 18, 0, 10.00, 7.50, 15.00, 9.90, 0, 0, 6, '让鲜甜挑逗你的味蕾，让美味在舌尖上跳舞，果肉翠绿，味道酸甜可口，有浓厚的清香味，维生素含量高，一口下去，呲 的 环绕整个味蕾，清甜而不腻。', 1538661862, 1538875643);
INSERT INTO `ts_header_group_product` VALUES (86, 1, 19, 130, '【冰雪皇后芝麻夹心海苔】4克*10小包*2包/份', -1, 3, 0, 10.00, 12.00, 18.00, 14.90, 0, 0, 7, '真正的夹心海苔，做到真正的鲜 香 脆！片片饱满的芝麻，铺在香酥的双面海苔上。香 酥 脆的优质口感，富含多重营养成分！满满的芝麻，非油炸更健康。保质期12个月，开袋即食。\n', 1538661862, 1538796498);
INSERT INTO `ts_header_group_product` VALUES (87, 1, 19, 108, '【80食堂酸辣粉】140克*2盒', -1, 2, 0, 10.00, 11.40, 18.00, 14.90, 0, 0, 8, '80食堂酸辣粉，大街小巷小馆子的童年老味道。红薯粉丝，品质更高。香滑细嫩，缠绵清爽！秘制椒香，红油辣子采用多种味料精心炒制而成，麻辣鲜香！陈年食醋，与红油辣子一同构成酸辣鲜爽的馋人味道！秘制料，熟花生，香脆鲜香，一包料，让汤更鲜美！美味豆皮，劲道有力，在粉丝缠绵口感之外，增加咀嚼', 1538661862, 1538904181);
INSERT INTO `ts_header_group_product` VALUES (88, 1, 19, 138, '【马来西亚mini奥利奥】原味、草莓各一包', 9999, 0, 0, 12.00, 18.00, 35.00, 24.90, 0, 0, 9, '融入法式浪漫，时刻定制你的美味', 1538661862, 1538796498);
INSERT INTO `ts_header_group_product` VALUES (89, 1, 19, 119, '【古早手工蛋糕】2个/份', -1, 1, 0, 18.00, 5.00, 12.00, 9.90, 0, 0, 10, '好品质源自好食材，卖相很Q，抵挡不住的美味诱惑，和牛奶一起吃，更好吃哦，金黄饱满，香浓软糯，吃起来奶香味浓，如云朵般轻盈软润的口感，入口即化，香味自然，‍传统手工艺制作。\n', 1538661862, 1538902149);
INSERT INTO `ts_header_group_product` VALUES (90, 1, 19, 127, '【FRUGO 100%苹果汁】250ML*2瓶/份', -1, 1, 0, 15.00, 5.00, 15.00, 9.90, 0, 0, 11, '波兰原瓶原装直购，百分百纯苹果汁，维生素C丰富，可增强人体抵抗力和机体的解毒功能，苹果汁是美容佳品，既减肥又能让皮肤润滑柔嫩，苹果中还有铜，碘，锰，锌，钾等元素，补充人体所需营养物质。无添加剂，百分百原汁。\n', 1538661862, 1538796498);
INSERT INTO `ts_header_group_product` VALUES (91, 1, 19, 137, '【新西进口 板栗南瓜】1个/份', 9991, 8, 0, 14.00, 6.20, 15.00, 9.90, 0, 0, 12, '板栗南瓜 丰富的VA，β葫萝卜素和膳食纤维，尤其是胡萝卜素含量极其高，可用于断奶食物的制作，是做宝宝食物的好材料，板栗口感，肉细嫩紧实，甜糯，糯软润滑，大火蒸30分钟即可，蒸熟后瓜皮瓜肉皆可食用。', 1538661862, 1538798391);
INSERT INTO `ts_header_group_product` VALUES (94, 1, 19, 141, '【印尼原装进口猫屎咖啡盒装】15克*5条', 999, 0, 0, 10.00, 21.00, 35.00, 27.00, 0, 0, 13, '印尼麝香猫咖啡是种咖啡豆，产自印尼苏门答腊亚崎山区，苏门答腊岛是是麝香猫咖啡的故乡。印度尼西亚山间有一种名叫路哇克(Luwak)的麝香猫喜欢吃多浆的咖啡果子，但坚硬的咖啡种籽无法消化，随粪便排出，印度尼西亚人发觉经过麝香猫肠胃发酵的咖啡豆，浓稠香醇，于是搜集麝香猫排泄物，筛滤出咖啡豆泡煮来喝，就这样做出了麝香猫咖啡。麝香猫 猫屎风味 它的风味浓郁 香 苦 醇厚！', 1538661862, 1538796498);
INSERT INTO `ts_header_group_product` VALUES (95, 1, 19, 142, '【玛俪娅 提拉米苏六寸】1个/份 抹茶味 ', 9998, 1, 0, 10.00, 12.70, 20.00, 15.90, 0, 0, 14, '匠心独运，相约相恋，奶油提拉米苏，惬意享受，悠闲时光，尽情享受快乐的每一秒，新鲜奶源，‍新鲜鸡蛋，进口面粉，精选蜂蜜，纯手工制作，自然回软，口感丰富。\n', 1538662139, 1538796498);
INSERT INTO `ts_header_group_product` VALUES (96, 1, 19, 143, '【玛俪娅 提拉米苏六寸】1个/份 可可味 ', 9997, 2, 0, 10.00, 12.70, 20.00, 15.90, 0, 0, 15, '匠心独运，相约相恋，奶油提拉米苏，惬意享受，悠闲时光，尽情享受快乐的每一秒，新鲜奶源，‍新鲜鸡蛋，进口面粉，精选蜂蜜，纯手工制作，自然回软，口感丰富。\n', 1538662139, 1538875132);
INSERT INTO `ts_header_group_product` VALUES (97, 1, 19, 92, '【大凉山石榴】1个/份', 0, 40, 0, 0.00, 1.00, 5.00, 1.00, 0, 1, 16, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1538662255, 1538796498);
INSERT INTO `ts_header_group_product` VALUES (98, 1, 20, 150, '【六合香辣肉排】2斤*1袋/份', -1, 0, 0, 10.00, 14.00, 25.00, 19.90, 0, 0, 5, '上班下班休闲娱乐你需要肉排来提升你的味觉，\n酥香可口，肉质细腻，🏻‍美味可口，好味道，好色相，好口感，好营养。', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (99, 1, 20, 146, '【海南丝路晓蜜】1个/份', -1, 0, 0, 15.00, 13.00, 26.00, 19.90, 0, 0, 0, '海南晓蜜蜜瓜，光照时间长，甜度高，味甜如蜜，🎊肉质细腻金黄，香甜清脆，甜如初恋，水分很足，皮很薄，甜度高于一般的哈密，深受果粉的喜爱。', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (100, 1, 20, 147, '【超细纤维毛巾】2条/份', -1, 0, 0, 20.00, 5.60, 16.00, 9.90, 0, 0, 4, '不掉毛，🎊不掉色 ，不抽丝 ，不脱圈 ，强吸水性，不留痕迹，💫强力吸尘不留痕迹，🎊超细纤维，亲肤柔软，厨房.客厅.擦车必备利器。', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (101, 1, 20, 148, '【新鲜采摘自家山楂】2斤/份', -1, 0, 0, 20.00, 5.00, 15.00, 9.90, 0, 0, 1, '酸酸甜甜就是我，酸甜软糯，无农药不洗直接吃，🎊山楂含有酒石酸，柠檬酸，果糖，维生素C，维生素B，尼克酸，钙铁硒，黄酮类等营养成分，其中维C的含量在水果中仅次于红枣和猕猴桃，胡萝卜素和钙的含量也很高。', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (102, 1, 20, 149, '【芳柔伊手帕纸】6小包/份', -1, 0, 0, 0.00, 3.00, 5.00, 3.00, 0, 0, 6, '本色竹浆返璞归真，原色纸 不漂白，自然更安全，四层加厚柔韧无添加，🎊无尘屑，无荧光剂，湿水不易破，💫给您优质的健康生活。', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (103, 1, 20, 136, '【湘西富硒米良猕猴桃】8个/份', -1, 0, 0, 10.00, 7.50, 15.00, 9.90, 0, 0, 2, '让鲜甜挑逗你的味蕾，让美味在舌尖上跳舞，果肉翠绿，味道酸甜可口，有浓厚的清香味，维生素含量高，一口下去，呲 的 环绕整个味蕾，清甜而不腻。', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (104, 1, 20, 116, '【四川安岳黄柠檬】2个*2包/份', -1, 0, 0, 25.00, 5.00, 13.00, 9.90, 0, 0, 3, '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (105, 1, 20, 104, '【喜世牛肉饼】10个*1袋/份', -1, 0, 0, 10.00, 10.00, 26.00, 23.80, 0, 0, 7, '鲜香多汁，美味可口，入口香酥，肉香四溢，香而不腻，风味独特，外焦里嫩，‍回味悠长。\n', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (106, 1, 20, 111, '【六合无骨鸡柳】2斤*1袋', -1, 0, 0, 10.00, 16.00, 25.00, 19.90, 0, 0, 8, '让你的味蕾来跳舞，油炸后‍回味悠长，更是带着美味扑鼻的香气，口感松脆鲜香，嫩滑香脆，搭配番茄酱吃到嘴里味道甜美，外皮酥嫩，色泽金黄，气味鲜香诱人，口感饱满嫩滑而富有弹性。', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (107, 1, 20, 128, '【思念小油条】 23根/袋 过油加热后食用', -1, 0, 0, 10.00, 16.00, 26.00, 19.90, 0, 0, 9, '国人传统风味，美味健康，精选优质小麦粉，口感极佳。\n色泽金黄，香气扑鼻，外层金黄酥脆，内层柔软白嫩，纯手工 工艺，无铅膨松剂，品味记忆里最熟悉的味道，\n早餐快捷制作，营养丰富，适合高品质快节奏生活，香浓可口，营养健康，带给你至高的早餐享受。', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (108, 1, 20, 122, '【吉娜蜂蜜麦片】250克*1包/份', -1, 0, 0, 15.00, 16.50, 30.00, 23.90, 0, 0, 10, '立陶宛直购，欧盟食品认证，健康膳食，口感香甜，燕麦里富含多种人体所需的膳食纤维，干吃，，牛奶冲泡，享受西式早餐带来的便捷与美味，富含维生素A.维生素D.维生素B1.维生素B2、维生素B6、维生素B12、维生素C等，而且口感香糯美味，黄金营养，吸收更好，补充能量，平衡饮食，易于消化。\n', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (109, 1, 20, 152, '【粉丝扇贝(蒜蓉味)】10个*1包/份', -1, 0, 0, 10.00, 15.00, 30.00, 19.90, 0, 0, 11, '新鲜加工，蒜香浓郁，鲜美细腻，肉质劲道，💫贝肉肥嫩，嫩滑细腻有弹性，🏻‍蒜泥配比匠心调制，鲜美细腻，🎊优质绿豆粉丝，口感嫩滑，好吃不长肉，夜宵伴侣。', 1538915939, 1538916101);
INSERT INTO `ts_header_group_product` VALUES (110, 1, 21, 149, '【芳柔伊手帕纸】6小包/份', -1, 1, 0, 0.00, 3.00, 5.00, 3.00, 0, 0, 0, '本色竹浆返璞归真，原色纸 不漂白，自然更安全，四层加厚柔韧无添加，🎊无尘屑，无荧光剂，湿水不易破，💫给您优质的健康生活。', 1538917025, 1538956864);
INSERT INTO `ts_header_group_product` VALUES (111, 1, 21, 148, '【新鲜采摘自家山楂】2斤/份', -1, 2, 0, 20.00, 5.00, 15.00, 9.90, 0, 0, 1, '酸酸甜甜就是我，酸甜软糯，无农药不洗直接吃，🎊山楂含有酒石酸，柠檬酸，果糖，维生素C，维生素B，尼克酸，钙铁硒，黄酮类等营养成分，其中维C的含量在水果中仅次于红枣和猕猴桃，胡萝卜素和钙的含量也很高。', 1538917025, 1538959281);
INSERT INTO `ts_header_group_product` VALUES (112, 1, 21, 146, '【海南丝路晓蜜】1个/份', -1, 1, 0, 15.00, 13.00, 26.00, 19.90, 0, 0, 2, '海南晓蜜蜜瓜，光照时间长，甜度高，味甜如蜜，🎊肉质细腻金黄，香甜清脆，甜如初恋，水分很足，皮很薄，甜度高于一般的哈密，深受果粉的喜爱。', 1538917025, 1538955926);
INSERT INTO `ts_header_group_product` VALUES (113, 1, 21, 136, '【湘西富硒米良猕猴桃】8个/份', -1, 0, 0, 10.00, 7.50, 15.00, 9.90, 0, 0, 3, '让鲜甜挑逗你的味蕾，让美味在舌尖上跳舞，果肉翠绿，味道酸甜可口，有浓厚的清香味，维生素含量高，一口下去，呲 的 环绕整个味蕾，清甜而不腻。', 1538917025, 1538917025);
INSERT INTO `ts_header_group_product` VALUES (114, 1, 21, 116, '【四川安岳黄柠檬】2个*2包/份', -1, 1, 0, 25.00, 5.00, 13.00, 9.90, 0, 0, 4, '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1538917025, 1538954498);
INSERT INTO `ts_header_group_product` VALUES (115, 1, 21, 147, '【超细纤维毛巾】2条/份', -1, 5, 0, 20.00, 5.60, 16.00, 9.90, 0, 0, 5, '不掉毛，🎊不掉色 ，不抽丝 ，不脱圈 ，强吸水性，不留痕迹，💫强力吸尘不留痕迹，🎊超细纤维，亲肤柔软，厨房.客厅.擦车必备利器。', 1538917025, 1538959281);
