INSERT INTO `ts_header_group_product` VALUES (117, 1, 21, 104, '【喜世牛肉饼】10个*1袋/份', -1, 3, 0, 10.00, 10.00, 26.00, 23.80, 0, 0, 7, '鲜香多汁，美味可口，入口香酥，肉香四溢，香而不腻，风味独特，外焦里嫩，‍回味悠长。\n', 1538917025, 1538956757);
