INSERT INTO `ts_header_group_product` VALUES (126, 1, 23, 92, '【突尼斯石榴】1个/份', -1, 0, 0, 0.00, 1.00, 5.00, 1.00, 0, 1, 0, '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1538983147, 1538983482);
INSERT INTO `ts_header_group_product` VALUES (127, 1, 23, 113, '【泰国青草药膏(卧佛牌)】1瓶*50克/份', -1, 0, 0, 7.00, 12.70, 18.00, 15.00, 0, 0, 3, '来自泰国，血统纯正，针对蚊虫叮咬，肌肉酸痛，筋骨扭伤，青紫瘀伤，关节痛，感冒，N种功效，一瓶解决，质保期3年，天然配方，樟脑.肉桂油.薄荷油.薄荷醇.雄性.雌性，健康安全，玉菩药堂手工制造，居家必备。', 1538983147, 1538983482);
