INSERT INTO `ts_header_group_product` VALUES (129, 1, 24, 91, '【自家山核桃】5斤/份', 11, 0, 0, 10.00, 15.00, 25.00, 19.90, 0, 0, 1, '自己家里的山核桃，无水洗，不漂白，更健康，原滋原味，果仁吃起来 脆嫩香甜，带着淡淡的核桃香。\n', 1539073124, 1539303334);
