INSERT INTO `ts_product` VALUES (113, '【泰国青草药膏(卧佛牌)】1瓶*50克/份', '来自泰国，血统纯正，针对蚊虫叮咬，肌肉酸痛，筋骨扭伤，青紫瘀伤，关节痛，感冒，N种功效，一瓶解决，质保期3年，天然配方，樟脑.肉桂油.薄荷油.薄荷醇.雄性.雌性，健康安全，玉菩药堂手工制造，居家必备。', 1, 1537973950, 1537973974);
