INSERT INTO `ts_product` VALUES (116, '【四川安岳黄柠檬】2个*4包/份', '皮薄肉厚，薄薄的果皮包裹着黄嫩嫩的果肉用小刀轻轻划开外皮，清香的汁水瞬间像精灵般流淌，酸爽多汁，柠檬味道算算哒，轻轻舔一口柠檬汁，仿佛瞬间就能酸到心底，加上蜂蜜百香果泡水喝，真是美味，季节交替妹子喝了美容养颜。\n', 1, 1538060346, 1538060448);
INSERT INTO `ts_product` VALUES (134, '【江西南丰贡桔】2斤/份', '果肉细腻，个小心甜，皮薄肉嫩，爽口化渣，橘香浓郁，柔软多汁，风味浓甜，小小果实，大大营养，维生素C含量特别高，维生素P，可溶性纤维，果酸，氨基酸，爱美的MM都爱哦，南丰蜜桔素有贡品之称。', 1, 1538659664, 1538659685);
INSERT INTO `ts_product` VALUES (118, '【琯溪三红蜜柚】3斤左右*2个/份', '皮红，囊红，肉红，千娇百媚，让你垂涎欲滴，未见其肉，先闻其香，水分充足，唇齿留香，汁多细腻，香甜可口，诱惑红肉，粒粒饱满晶莹。\n', 1, 1538060490, 1538060490);
INSERT INTO `ts_product` VALUES (119, '【古早手工蛋糕】2个/份', '好品质源自好食材，卖相很Q，抵挡不住的美味诱惑，和牛奶一起吃，更好吃哦，金黄饱满，香浓软糯，吃起来奶香味浓，如云朵般轻盈软润的口感，入口即化，香味自然，‍传统手工艺制作。\n', 1, 1538060526, 1538060526);
INSERT INTO `ts_product` VALUES (120, '【香港百贝滋鲜鸡蛋卷】蟹黄味 2包/份', '网红蛋卷系列，放心 安心 良心，把快乐传递，将快乐分享，原蛋手打，严选细作，看得见的黑芝麻，闻得到的鸡蛋味，酥脆浓香，轻咬酥脆溶于口，口感清新不油腻，酥，脆，香，传统手工制作。\n', 1, 1538060573, 1538061656);
INSERT INTO `ts_product` VALUES (121, '【自家现挖毛芋头】4斤/份', '自己老家的毛芋头，自己种植，自然成熟，不使用任何农药，吃的放心，清香软糯，绵柔软滑，甘甜可口，蒸 炒 炸 炖皆可，我都是香芋炖排骨吃，‍恰到好处的美妙滋味，老少皆宜。\n', 1, 1538060673, 1538060673);
INSERT INTO `ts_product` VALUES (122, '【吉娜蜂蜜麦片】250克*1包/份', '立陶宛直购，欧盟食品认证，健康膳食，口感香甜，燕麦里富含多种人体所需的膳食纤维，干吃，，牛奶冲泡，享受西式早餐带来的便捷与美味，富含维生素A.维生素D.维生素B1.维生素B2、维生素B6、维生素B12、维生素C等，而且口感香糯美味，黄金营养，吸收更好，补充能量，平衡饮食，易于消化。\n', 1, 1538060926, 1538060926);
INSERT INTO `ts_product` VALUES (123, '【进口奶油夹心威化球】椰子味 300克*1包/份', '波兰直购，欧盟食品认证，奶油夹心花生酥威化球，伴着淡淡的香气，甜滑爽口，酥脆柔滑奇妙结合，丝滑奶油，香浓花生，甜而不腻，回味无穷，源自波兰美味。\n', 1, 1538061323, 1538061323);
INSERT INTO `ts_product` VALUES (124, '【进口奶油夹心威化球】花生味 300克*1包/份', '波兰直购，欧盟食品认证，奶油夹心花生酥威化球，伴着淡淡的香气，甜滑爽口，酥脆柔滑奇妙结合，丝滑奶油，香浓花生，甜而不腻，回味无穷，源自波兰美味。\n', 1, 1538061381, 1538061381);
INSERT INTO `ts_product` VALUES (125, '【香港百贝滋鲜鸡蛋卷】芝麻味 2包/份', '网红蛋卷系列，放心 安心 良心，把快乐传递，将快乐分享，原蛋手打，‍严选细作，看得见的黑芝麻，闻得到的鸡蛋味，酥脆浓香，轻咬酥脆溶于口，口感清新不油腻，酥，脆，香，传统手工制作。\n', 1, 1538061502, 1538061648);
INSERT INTO `ts_product` VALUES (126, '【圣塔索菲亚 管状意大利面】500克*1包/份', '土耳其直购管状意大利面，‍美味口感，20分钟简餐，美味源自不添加，Q弹爽滑，口感劲道，耐煮不黏连，滋滋美味，念念不忘。\n', 1, 1538061629, 1538061629);
INSERT INTO `ts_product` VALUES (127, '【FRUGO 100%苹果汁】250ML*2瓶/份', '波兰原瓶原装直购，百分百纯苹果汁，维生素C丰富，可增强人体抵抗力和机体的解毒功能，苹果汁是美容佳品，既减肥又能让皮肤润滑柔嫩，苹果中还有铜，碘，锰，锌，钾等元素，补充人体所需营养物质。无添加剂，百分百原汁。\n', 1, 1538061688, 1538061688);
INSERT INTO `ts_product` VALUES (128, '【思念小油条】 23根/袋 过油加热后食用', '国人传统风味，美味健康，精选优质小麦粉，口感极佳。\n色泽金黄，香气扑鼻，外层金黄酥脆，内层柔软白嫩，纯手工 工艺，无铅膨松剂，品味记忆里最熟悉的味道，\n早餐快捷制作，营养丰富，适合高品质快节奏生活，香浓可口，营养健康，带给你至高的早餐享受。', 1, 1538061891, 1538061891);
INSERT INTO `ts_product` VALUES (129, '【西班牙原装进口橄榄油】250ml*1瓶/份', '伯爵品质 经典传承，油中贵族，口服，凉拌，清炒，蒸饭，做汤，煎炸，烧烤， 蘸食，护肤均可使用，‍橄榄油被认为是迄今发现的油脂中最适合人体营养的油脂，具有活血化瘀，降压降脂，美容养颜，健脑益智，长期食用还可以提高记忆力和抵抗力。\n', 1, 1538061937, 1538061937);
INSERT INTO `ts_product` VALUES (130, '【冰雪皇后芝麻夹心海苔】4克*10小包*2包/份', '真正的夹心海苔，做到真正的鲜 香 脆！片片饱满的芝麻，铺在香酥的双面海苔上。香 酥 脆的优质口感，富含多重营养成分！满满的芝麻，非油炸更健康。保质期12个月，开袋即食。\n', 1, 1538062036, 1538062036);
INSERT INTO `ts_product` VALUES (131, '【得利斯奶黄包】 12个*2袋/份', '优选小麦粉，弹滑面皮不粘牙，入口香甜软绵，舌尖味蕾悠然舒展。\n小小个造型，香甜软绵。\n用心挑选，自然与汗水的结晶，造就美味食品，免去繁琐制作过程，加热即可，美味即成。', 1, 1538062179, 1538062179);
INSERT INTO `ts_product` VALUES (132, '【思念2.25kg手抓饼】原味 25片*1盒/份', '营养早餐必备，吃过都说好！', 1, 1538062350, 1538062382);
INSERT INTO `ts_product` VALUES (133, '【思念2.25kg手抓饼】葱香味 25片*1盒/份', '营养早餐必备，吃过都说好！！', 1, 1538062443, 1538062443);
INSERT INTO `ts_product` VALUES (135, '【砀山梨】5斤/份', '皮薄细腻无渣，酥脆清甜，充足的水分，自然生长的香甜，一口咬下去满口流汁的畅爽。\n轻嚼满嘴甜汁，啖之清甜留香', 1, 1538659844, 1538659873);
INSERT INTO `ts_product` VALUES (136, '【湘西富硒米良猕猴桃】5个/份', '让鲜甜挑逗你的味蕾，让美味在舌尖上跳舞，果肉翠绿，味道酸甜可口，有浓厚的清香味，维生素含量高，一口下去，呲 的 环绕整个味蕾，清甜而不腻。', 1, 1538660446, 1538660446);
INSERT INTO `ts_product` VALUES (137, '【新西进口 板栗南瓜】1个/份', '板栗南瓜 丰富的VA，β葫萝卜素和膳食纤维，尤其是胡萝卜素含量极其高，可用于断奶食物的制作，是做宝宝食物的好材料，板栗口感，肉细嫩紧实，甜糯，糯软润滑，大火蒸30分钟即可，蒸熟后瓜皮瓜肉皆可食用。', 1, 1538660580, 1538660597);
INSERT INTO `ts_product` VALUES (138, '【马来西亚mini奥利奥】原味、草莓各一包', '融入法式浪漫，时刻定制你的美味', 1, 1538660660, 1538660660);
INSERT INTO `ts_product` VALUES (146, '【海南丝路晓蜜】1个/份', '海南晓蜜蜜瓜，光照时间长，甜度高，味甜如蜜，🎊肉质细腻金黄，香甜清脆，甜如初恋，水分很足，皮很薄，甜度高于一般的哈密，深受果粉的喜爱。', 1, 1538913453, 1538913881);
INSERT INTO `ts_product` VALUES (145, '测试商品', '我是测试商品🍎我是测试商 品🍎🐎', 2, 1538666509, 1538667297);
INSERT INTO `ts_product` VALUES (147, '【超细纤维毛巾】2条/份', '不掉毛，🎊不掉色 ，不抽丝 ，不脱圈 ，强吸水性，不留痕迹，💫强力吸尘不留痕迹，🎊超细纤维，亲肤柔软，厨房.客厅.擦车必备利器。', 1, 1538913537, 1538913537);
INSERT INTO `ts_product` VALUES (148, '【新鲜采摘自家山楂】2斤/份', '酸酸甜甜就是我，酸甜软糯，无农药不洗直接吃，🎊山楂含有酒石酸，柠檬酸，果糖，维生素C，维生素B，尼克酸，钙铁硒，黄酮类等营养成分，其中维C的含量在水果中仅次于红枣和猕猴桃，胡萝卜素和钙的含量也很高。', 1, 1538913623, 1538913623);
INSERT INTO `ts_product` VALUES (149, '【芳柔伊手帕纸】6小包/份', '本色竹浆返璞归真，原色纸 不漂白，自然更安全，四层加厚柔韧无添加，🎊无尘屑，无荧光剂，湿水不易破，💫给您优质的健康生活。', 1, 1538913850, 1538914420);
INSERT INTO `ts_product` VALUES (141, '【印尼原装进口猫屎咖啡盒装】15克*5条', '印尼麝香猫咖啡是种咖啡豆，产自印尼苏门答腊亚崎山区，苏门答腊岛是是麝香猫咖啡的故乡。印度尼西亚山间有一种名叫路哇克(Luwak)的麝香猫喜欢吃多浆的咖啡果子，但坚硬的咖啡种籽无法消化，随粪便排出，印度尼西亚人发觉经过麝香猫肠胃发酵的咖啡豆，浓稠香醇，于是搜集麝香猫排泄物，筛滤出咖啡豆泡煮来喝，就这样做出了麝香猫咖啡。麝香猫 猫屎风味 它的风味浓郁 香 苦 醇厚！', 1, 1538660864, 1538660864);
INSERT INTO `ts_product` VALUES (142, '【玛俪娅 提拉米苏六寸】1个/份 抹茶味 ', '匠心独运，相约相恋，奶油提拉米苏，惬意享受，悠闲时光，尽情享受快乐的每一秒，新鲜奶源，‍新鲜鸡蛋，进口面粉，精选蜂蜜，纯手工制作，自然回软，口感丰富。\n', 1, 1538661932, 1538661932);
INSERT INTO `ts_product` VALUES (143, '【玛俪娅 提拉米苏六寸】1个/份 可可味 ', '匠心独运，相约相恋，奶油提拉米苏，惬意享受，悠闲时光，尽情享受快乐的每一秒，新鲜奶源，‍新鲜鸡蛋，进口面粉，精选蜂蜜，纯手工制作，自然回软，口感丰富。\n', 1, 1538661958, 1538661958);
INSERT INTO `ts_product` VALUES (150, '【六合香辣肉排】2斤*1袋/份', '上班下班休闲娱乐你需要肉排来提升你的味觉，\n酥香可口，肉质细腻，🏻‍美味可口，好味道，好色相，好口感，好营养。', 1, 1538914564, 1538914564);
INSERT INTO `ts_product` VALUES (152, '【粉丝扇贝(蒜蓉味)】10个*1包/份', '新鲜加工，蒜香浓郁，鲜美细腻，肉质劲道，💫贝肉肥嫩，嫩滑细腻有弹性，🏻‍蒜泥配比匠心调制，鲜美细腻，🎊优质绿豆粉丝，口感嫩滑，好吃不长肉，夜宵伴侣。', 1, 1538915330, 1538915330);
INSERT INTO `ts_product_copy` VALUES (91, '【自家山核桃】5斤/份', '自己家里的山核桃，无水洗，不漂白，更健康，原滋原味，果仁吃起来 脆嫩香甜，带着淡淡的核桃香。\n', 1, 1537873772, 1538659330);
INSERT INTO `ts_product_copy` VALUES (92, '【突尼斯石榴】1个/份', '紧实饱满，晶莹剔透，皮薄个大，色泽均匀，\n软籽 新鲜多汁，有机多汁好石榴。\n一个有故事的石榴，不是很红但是很甜。\n轻轻一口，味甜 汁如泉涌。\n石榴果实营养丰富，维生素C含量比苹果，梨高出2倍多，好果子 好营养，好石榴 好健康。', 1, 1537873914, 1537873914);
INSERT INTO `ts_product_copy` VALUES (93, '【海南紫水晶红心火龙果】4个/份 ', '紫水晶红心火龙果的糖分达20°以上，味儿，口感特甜，个大饱满中间圆润并凸起，果皮外像鳞一样一片片外翻为上品，而且捏起来有一点点软的这样的会超级好吃，爆汁的甜，不甜不要钱，我敢这样说。\n特别说明：皮皱，叶鳞发黑，是它在树上就长成这样，因为这款紫水晶皮薄，受到北纬18°的高温炙烤，造成皱皮，叶鳞枯萎，但果肉相反甜到爆，是这款紫水晶火龙果的标志。\n', 1, 1537874513, 1538659349);
INSERT INTO `ts_product_copy` VALUES (94, '【新疆吐鲁番西州蜜 哈密瓜】1个/份 4斤左右', '来自火焰山的甜蜜问候。唤醒你的味觉！\n甘甜可口 肉质细嫩，果肉越靠近中心处甜度越高，清脆爽口，汁多且无渣，清香四溢。', 1, 1537880895, 1537885588);
INSERT INTO `ts_product_copy` VALUES (95, '【无淀粉肉肠】10根/份', '无淀粉全肉肠，满口留香，劲道口感，手抓饼好搭档。微波炉加热食用。\n', 1, 1537882298, 1537882298);
INSERT INTO `ts_product_copy` VALUES (104, '【喜世牛肉饼】10个*1袋/份', '鲜香多汁，美味可口，入口香酥，肉香四溢，香而不腻，风味独特，外焦里嫩，‍回味悠长。\n', 1, 1537884089, 1537884089);
INSERT INTO `ts_product_copy` VALUES (103, '【80食堂酸辣粉】140克*2盒', '80食堂酸辣粉，大街小巷小馆子的童年老味道。红薯粉丝，品质更高。香滑细嫩，缠绵清爽！秘制椒香，红油辣子采用多种味料精心炒制而成，麻辣鲜香！陈年食醋，与红油辣子一同构成酸辣鲜爽的馋人味道！秘制料，熟花生，香脆鲜香，一包料，让汤更鲜美！美味豆皮，劲道有力，在粉丝缠绵口感之外，增加咀嚼的快感！保质期365天', 1, 1537882935, 1537883983);
INSERT INTO `ts_product_copy` VALUES (105, '【五香花卷】 60个/带', '乡间石磨小麦粉，整粒麦的营养都在里面，吃起来粮食味浓郁醇香。\n童年是梦 是诗，让人慢慢品味，顽皮的我们，喜欢课堂背着老师偷偷分享，喜欢揪着女同学的长发，喜欢……儿时的味道，怀念就把它带回家吧', 1, 1537884274, 1537884274);
INSERT INTO `ts_product_copy` VALUES (106, '【六合无骨鸡柳】2斤*1袋', '让你的味蕾来跳舞，油炸后‍回味悠长，更是带着美味扑鼻的香气，口感松脆鲜香，嫩滑香脆，搭配番茄酱吃到嘴里味道甜美，外皮酥嫩，色泽金黄，气味鲜香诱人，口感饱满嫩滑而富有弹性。\n', 1, 1537884306, 1537884306);
INSERT INTO `ts_product_copy` VALUES (107, '【沾化冬枣】2斤/份', '用心寻找 品一口脆甜冬枣，好产地，产好枣个大，皮薄，核小，肉厚，味脆甜，汁多。枣香四溢，刚下枝头，即上舌尖，咬一口嘎嘣脆，甜赛蜜浆，甘甜多汁。', 1, 1537884447, 1537884447);
INSERT INTO `ts_product_copy` VALUES (108, '【80食堂酸辣粉】140克*2盒', '80食堂酸辣粉，大街小巷小馆子的童年老味道。红薯粉丝，品质更高。香滑细嫩，缠绵清爽！秘制椒香，红油辣子采用多种味料精心炒制而成，麻辣鲜香！陈年食醋，与红油辣子一同构成酸辣鲜爽的馋人味道！秘制料，熟花生，香脆鲜香，一包料，让汤更鲜美！美味豆皮，劲道有力，在粉丝缠绵口感之外，增加咀嚼', 1, 1537888788, 1537888788);
INSERT INTO `ts_product_copy` VALUES (109, '【五香花卷】 60个/带', '乡间石磨小麦粉，整粒麦的营养都在里面，吃起来粮食味浓郁醇香。\n童年是梦 是诗，让人慢慢品味，顽皮的我们，喜欢课堂背着老师偷偷分享，喜欢揪着女同学的长发，喜欢……儿时的味道，怀念就把它带回家吧', 1, 1537889357, 1537889357);
